import React from 'react';
import { Route, Routes } from 'react-router-dom';
import { Home } from '../MiddleSection/Home'; // Update the import statement

export const RouteFiles = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
  );
};
